import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom"; // Asegúrate de importar useNavigate
import style from "./Form.module.css";
import axios from "axios";
import { GoogleLogin } from "react-google-login";
import { gapi } from "gapi-script";

const Form = () => {
  const [form, setForm] = useState({
    name: "",
    lastName: "",
    image: "",
    email: "",
    phone: "",
    nameUser: "",
    password: "",
  });

  const [errors, setErrors] = useState({
    email: "",
  });

  const navigate = useNavigate(); // Inicializa useNavigate

  // Inicializar gapi
  useEffect(() => {
    const initClient = () => {
      gapi.client.init({
        clientId:
          "133661170359-fkebjnpt8sudfqujbcjbjrtj1cc8veoc.apps.googleusercontent.com",
        scope: "email",
      });
    };
    gapi.load("client:auth2", initClient);
  }, []);

  // Generación de cadena aleatoria para datos ficticios
  const generateRandomString = (length) => {
    const characters =
      "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
    let result = "";
    for (let i = 0; i < length; i++) {
      result += characters.charAt(
        Math.floor(Math.random() * characters.length)
      );
    }
    return result;
  };

  // Manejo del inicio de sesión con Google
  const onSuccessGoogle = async (response) => {
    const userInfo = response.profileObj;

    // Generar valores aleatorios
    const randomPhone = `+1${
      Math.floor(Math.random() * 9000000000) + 1000000000
    }`;
    const randomNameUser = `${userInfo.givenName}${
      userInfo.familyName
    }${Math.floor(Math.random() * 1000)}`;
    const randomPassword = generateRandomString(12);

    setForm({
      ...form,
      name: userInfo.givenName,
      lastName: userInfo.familyName,
      email: userInfo.email,
      image: userInfo.imageUrl,
      phone: randomPhone,
      nameUser: randomNameUser,
      password: randomPassword,
    });

    // Enviar los datos al servidor
    try {
      const res = await axios.post("http://localhost:3001/users/createUser", {
        name: userInfo.givenName,
        lastName: userInfo.familyName,
        email: userInfo.email,
        image: userInfo.imageUrl,
        phone: randomPhone,
        nameUser: randomNameUser,
        password: randomPassword,
      });

      alert("Usuario creado con Google: " + res.data.message);

      // Redirigir al perfil del usuario
      navigate("/userProfile"); // Redirigir a la página de perfil del usuario
    } catch (error) {
      console.error(
        "Error al crear el usuario con Google:",
        error.response?.data || error.message
      );
      alert("Error al crear el usuario con Google");
    }
  };

  const onFailureGoogle = (response) => {
    console.error("Error en la autenticación con Google:", response);
    alert("Error en la autenticación con Google");
  };

  // Resto de tu código...

  return (
    <div>
      <form onSubmit={submitHandler}>
        <div className={style.mainContainer}>
          <label>Name: </label>
          <input
            type="text"
            value={form.name}
            onChange={onChangeHandler}
            name="name"
          />
          <label>LastName: </label>
          <input
            type="text"
            value={form.lastName}
            onChange={onChangeHandler}
            name="lastName"
          />
          <label>Image: </label>
          <input type="file" onChange={onImageUploadHandler} name="image" />
          {form.image && (
            <img src={form.image} alt="Imagen subida" width="100" />
          )}
          <label>Email: </label>
          <input
            type="text"
            value={form.email}
            onChange={onChangeHandler}
            name="email"
          />
          {errors.email && <span>{errors.email}</span>}
          <label>Phone: </label>
          <input
            type="text"
            value={form.phone}
            onChange={onChangeHandler}
            name="phone"
          />
          <label>NameUser: </label>
          <input
            type="text"
            value={form.nameUser}
            onChange={onChangeHandler}
            name="nameUser"
          />
          <label>Password: </label>
          <input
            type="password"
            value={form.password}
            onChange={onChangeHandler}
            name="password"
          />
          <button type="submit">Enviar</button>
        </div>
      </form>

      <div className={style.oauthContainer}>
        <p>O inicia sesión con Google:</p>
        <GoogleLogin
          clientId="TU_CLIENT_ID_DE_GOOGLE.apps.googleusercontent.com" // Reemplaza con tu ID de cliente
          buttonText="Login with Google"
          onSuccess={onSuccessGoogle}
          onFailure={onFailureGoogle}
          cookiePolicy={"single_host_origin"}
        />
      </div>
    </div>
  );
};

export default Form;
